import React from "react";
import "./master.css";

const Master = () => {
  return (
    <div className="master">
      <h2>
        Vi är <span> MÄSTARE </span> på falafel!
      </h2>
      <img
        src={require("../../images/crown.svg")}
        alt="crown"
        className="crown"
      />

      <h2> Ring och beställ på 073-486 69 45 </h2>
    </div>
  );
};

export default Master;
